import React from "react";
// Estilos
import './App.scss';
// Sistema de Routeo
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import routes from "./config/routes";

// Componentes
import AdminHome from './pages/Admin';


function App() {
  return (
      <Router>
        {/* la funcion routes.map es un bule que recorre el array routes
        devolviendo "route" como cada item, e index como la posiciÃ³n */}
          {routes.map((route, index) => (
            <RouterWithSubRouters key={index} route={route} />
          ))}
      </Router> 
  );
};

function RouterWithSubRouters(props) {
  const {route} = props;

  return(
    <Routes>
      {route.routes.map((item, index) => (
        <Route
          key={index}
          path={item.path}
          element={<route.component route={route.routes}/>}
        />
      ))}
    </Routes>
  );
}

export default App;
